import {Routes, Route, useNavigate} from 'react-router-dom'

import TestBfa from '..TestBfa'

export default function Test(){
    const navigate = useNavigate();

const navigateNext= () =>{
    navigate('/testbfa');
};

    return (
    <div>
        <div>
            <h1>Teszt</h1>
            <button onClick={navigateNext}>Kezdés</button>                     
        </div>

        <Routes>
             <Route path="testbfa" element={<TestBfa />}/>

        </Routes>
    </div>
    )
}
